script: |
  super -f text -I q2632.spq | sort > q2632.out

inputs:
  - name: q2632.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - 92 * ( + col2 ) + col0 + + col2 / col2 BETWEEN + col1 AND NULL;
  - name: tab2

outputs:
  - name: q2632.out
    data: |
      46	51	23
      64	77	40
      75	67	58
